import React, {Component} from 'react';
import { Grid, Cell} from 'react-mdl';
class Skills extends Component {
    render(){
        return(
            <div>
            <Grid>
                     <Cell>
                         <h1>Experience</h1>
                     </Cell>
                 </Grid>
             
            </div>
        )
    }
}

export  default Skills ;
